define({"topics" : [{"title":"Installing and configuring Microsoft components for on-premises TFS","shortdesc":"\n                     <p class=\"shortdesc\">This section and its subtopics list out a number of components of Microsoft&apos;s   Application Lifecycle Management (ALM) environment\n                        that need to be installed and configured for   on-premises TFS.\n                     </p>\n                  ","id":"concept_dfp_pv2_3r","href":"TA_Help\/Topics\/ug_MTM_configuration.html","menu": {"hasChildren":false,},"tocID":"concept_dfp_pv2_3r-d46e24421","next":"concept_dfp_pv2_3r-d46e24421",},{"title":"Authoring test procedures under on-premises TFS","shortdesc":"\n                     <p class=\"shortdesc\">This section describes how to set up a <span class=\"ph\">TestArchitect</span>   project to allow for tests to be managed and exchanged with TFS. With your TA project integrated   with TFS-MTM, you can\n                        import TFS test cases and test suites into TA and, conversely, upload TA   test cases, test modules and test folders into\n                        TFS.\n                     </p>\n                  ","id":"concept_s52_k3c_h5","href":"TA_Help\/Topics\/ug_MTM_set_up_TA.html","menu": {"hasChildren":false,},"tocID":"concept_s52_k3c_h5-d46e24679","next":"concept_s52_k3c_h5-d46e24679",},{"title":"Running tests under on-premises TFS","shortdesc":"\n                     <p class=\"shortdesc\">With TFS-MTM integration in place, you have the option of launching your automated TA   tests from <em class=\"ph i\">either</em> environment. And in both cases, you can have your test results   automatically (or manually) sent to TFS.\n                     </p>\n                  ","id":"concept_m5y_l3c_h5","href":"TA_Help\/Topics\/ug_MTM_test_execution.html","menu": {"hasChildren":false,},"tocID":"concept_m5y_l3c_h5-d46e24780","next":"concept_m5y_l3c_h5-d46e24780",}]});